import React from 'react';
import styled from 'styled-components';
import {NavLink} from 'react-router-dom';

function Nav() {
  return (
    <div>

      <h2>Blog</h2>

      <ul>
        <li>
          <NavLink to="/animals">Animals</NavLink>
        </li>
      </ul>
    </div>
  )
}

export default Nav
